import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import AppLogin from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/logingsignup.js'; // Ensure the correct file path
import AppItinerary from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/itinerary.js';
import AppTrip from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/itinerary.js';


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/login" element={<AppLogin />} />
          <Route path="/" element={<AppItinerary />} /> {/* Set itinerary as default route */}
          <Route path="/trip" element={<AppTrip />} />

          {/* Add other routes as needed */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
